import React, { Component } from 'react'

class TrackCard extends Component{


    handleHoverIn = () => {
      console.log('going in now');
    }
    handleHoverOut = () => {
      console.log('going out now');
    }

    render(){
        console.log(this.props.data.images[2].url);
        return(
          <div className='track-card' style={{ backgroundImage: `url(${this.props.data.images[1].url})`}} onMouseenter={this.handleHoverIn} onMouseleave={this.handleHoverOut}>
            <audio> </audio>
          </div>
        )
    }
}

export default TrackCard;
